<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Encryptor</title>
    <link rel="manifest" href="manifest.json">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@100..900&family=Roboto+Mono&display=swap" rel="stylesheet">
    <style>
        body {font-family: 'Inter', system-ui, sans-serif;padding: 24px;margin: 0;touch-action: manipulation;background-color: #ffffff;color: #000000;transition: background-color 0.3s ease, color 0.3s ease;}
        body.dark-theme {background-color: #1a1a1a;color: #ffffff;}
        .module-container {max-width: 600px;margin: auto;}
        #krypton_h7_container {--bg-main: #ffffff;--bg-secondary: #ffffff;--border-color: #D1D5DB;--text-main: #000000;--text-secondary: #000000;--accent-color: #6366F1;--accent-hover: #4F46E5;--error-color: #dc2626;--success-color: #16a34a;--blue-color: #3B82F6;position: relative;}
        #krypton_h7_container .label-container {min-height: 24px;height: 24px;display: block;margin-bottom: 8px;}
        #krypton_h7_container label {font-weight: 400;font-size: 1.1em;color: var(--text-secondary);display: block;height: 24px;line-height: 24px;}
        #krypton_h7_container .password-container {display: flex;align-items: center;gap: 8px;border: 1px solid var(--border-color);border-radius: 8px;padding-right: 8px;margin-top: 4px;margin-bottom: 16px;height: 48px;min-height: 48px;box-sizing: border-box;}
        #krypton_h7_container .password-container:focus-within {border-color: var(--accent-color);box-shadow: 0 0 0 1px var(--accent-hover);}
        #krypton_h7_container .output-wrapper {position: relative;min-height: 280px;}
        #krypton_h7_container #omega_t4_header {display: flex;flex-direction: row;align-items: center;justify-content: space-between;gap: 8px;margin-bottom: 12px;min-height: 30px;height: 30px;}
        #krypton_h7_container #omega_t4_label {font-family: 'Inter', system-ui, sans-serif;font-weight: 700;font-size: 1.3em;color: var(--text-secondary);line-height: 30px;flex-grow: 1;white-space: nowrap;overflow: hidden;display: block;text-align: left;}
        #krypton_h7_container #omega_t4_header .button-group {display: flex;gap: 8px;flex-shrink: 0;margin-left: auto;}
        #krypton_h7_container .password-container input {border: none;box-shadow: none;margin: 0;padding: 12px;flex-grow: 1;width: 100%;background-color: transparent;color: var(--text-main);font-size: 1em;font-family: 'Roboto Mono', monospace;border-top-left-radius: 8px;border-bottom-left-radius: 8px;height: 48px;min-height: 48px;box-sizing: border-box;}
        #krypton_h7_container .password-container input:focus {outline: none;box-shadow: none;}
        #krypton_h7_container #gamma_x5_toggle {background: none;border: none;padding: 4px;margin: 0;cursor: pointer;color: var(--text-secondary);display: flex;align-items: center;justify-content: center;width: auto;border-radius: inherit;position: relative;}
        #krypton_h7_container #gamma_x5_toggle:hover::after, #krypton_h7_container #gamma_x5_toggle:active::after {content: '';position: absolute;width: 24px;height: 24px;background-color: rgba(106, 108, 206, 0.3);border-radius: 50%;top: 50%;left: 50%;transform: translate(-50%, -50%);z-index: -1;}
        #krypton_h7_container textarea {width: 100%;padding: 12px;margin-top: 0;margin-bottom: 16px;border-radius: 8px;border: 1px solid var(--border-color);background-color: var(--bg-secondary);color: var(--text-main);font-size: 1em;box-sizing: border-box;font-family: 'Roboto Mono', monospace;resize: none;}
        #krypton_h7_container textarea:focus {outline: none;border-color: var(--accent-color);box-shadow: 0 0 0 1px var(--accent-hover);}
        #krypton_h7_container textarea#delta_m1_output.error {border-color: var(--error-color);box-shadow: 0 0 0 1px var(--error-color);}
        #krypton_h7_container textarea#delta_m1_output.success {border-color: var(--success-color);box-shadow: 0 0 0 1px var(--success-color);}
        #krypton_h7_container textarea#delta_m1_output {height: 250px;}
        #krypton_h7_container textarea#zeta_q9_input {height: 250px;margin-top: 4px;}
        #krypton_h7_container .button-container {display: flex;justify-content: center;gap: 12px;margin: 8px 0;min-height: 50px;height: 50px;align-items: center;}
        #krypton_h7_container .button-container button {width: 140px;line-height: 26px;vertical-align: middle;min-height: 50px;height: 50px;border: 1px solid var(--accent-color);}
        #krypton_h7_container button {background-color: transparent;color: var(--accent-color);font-size: 1.25em;font-weight: 600;padding: 12px 0;border-radius: 8px;border: 1px solid var(--accent-color);cursor: pointer;box-sizing: border-box;display: inline-flex;align-items: center;justify-content: center;min-height: 50px;height: 50px;}
        #krypton_h7_container button:disabled {cursor: not-allowed;opacity: 0.5;pointer-events: none;}
        #krypton_h7_container button:hover, #krypton_h7_container button:active {background-color: var(--accent-color);color: #ffffff;}
        #krypton_h7_container #util_c_btn, #krypton_h7_container #util_r_btn {font-size: 0.9em;font-weight: 500;width: 34px;height: 34px;padding: 8px;display: flex;align-items: center;justify-content: center;border: none;position: relative;z-index: 1;touch-action: manipulation;}
        #krypton_h7_container #util_r_btn {color: var(--error-color);}
        #krypton_h7_container #util_r_btn:hover, #krypton_h7_container #util_r_btn:active {background-color: transparent;border: none;}
        #krypton_h7_container #util_r_btn:hover::after, #krypton_h7_container #util_r_btn:active::after {content: '';position: absolute;width: 28px;height: 28px;background-color: rgba(248, 113, 113, 0.3);border-radius: 50%;top: 50%;left: 50%;transform: translate(-50%, -50%);z-index: -1;}
        #krypton_h7_container #util_c_btn {color: var(--blue-color);}
        #krypton_h7_container #util_c_btn svg {stroke: var(--blue-color);width: 24px;height: 24px;}
        #krypton_h7_container #util_c_btn:hover, #krypton_h7_container #util_c_btn:active {background-color: transparent;border: none;}
        #krypton_h7_container #util_c_btn:hover::after, #krypton_h7_container #util_c_btn:active::after {content: '';position: absolute;width: 28px;height: 28px;background-color: rgba(96, 165, 250, 0.3);border-radius: 50%;top: 50%;left: 50%;transform: translate(-50%, -50%);z-index: -1;}
        #krypton_h7_container #util_r_btn svg {width: 24px;height: 24px;}
        #krypton_h7_container #util_c_btn .copy-icon {display: block;}
        #krypton_h7_container #util_c_btn .check-icon {display: none;}
        #krypton_h7_container #util_c_btn.copied .copy-icon {display: none;}
        #krypton_h7_container #util_c_btn.copied .check-icon {display: block;}
        #krypton_h7_container #status_vocalizer_z1 {position: absolute;width: 1px;height: 1px;padding: 0;margin: -1px;overflow: hidden;clip: rect(0, 0, 0, 0);white-space: nowrap;border-width: 0;}
    </style>
